//返回标签分类颜色
function getStringTagColor(item) {
  if (item && item.color) {
    return "#" + item.color;
  }
  var color = "#7265e6";
  if (item && item.id) {
    if (item.type != "1") {
      if (item) {
        var pids = item.id.charAt(item.id.length - 1);
        if (isNaN(pids)) {
          color = "#fdbb78";
        } else {
          if (parseInt(pids) > 4) {
            color = "#c8c4fc";
          } else {
            color = "#89c997";
          }
        }
      } else {
        color = "#75ccff";
      }
    }
  }
  return color;
}

